        Closing Documents\n\n\nConsumer Financial\nProtection Bureau\n\nGuide to closing
        forms\nClosing Disclosure interactive tool\n\nPromissory Note �����������������������������������������������������������������������������������
        1\n\nMortgage / Security Instrument ��������������������������������������������������
        2\n\nInitial Escrow Disclosure ������������������������������������������������������������������
        3\n\nRight to Cancel form ��������������������������������������������������������������������������
        4\n\nLearn more at consumerfinance.gov/owning-a-home\n\nhttp://www.consumerfinance.gov/owning-a-home/closing-disclosure\n\n\n
        \nIf Lender exercises this option, Lender shall give Borrower notice of acceleration.  The
        notice shall \n\nprovide a period of not less than 30 days from the date the
        notice is given in accordance with Section 15 \nwithin which Borrower must
        pay all sums secured by this Security Instrument.  If Borrower fails to pay
        these \nsums prior to the expiration of this period, Lender may invoke any
        remedies permitted by this Security \nInstrument without further notice or
        demand on Borrower. \n\n \nWITNESS THE HAND(S) AND SEAL(S) OF THE UNDERSIGNED.
        \n \n \n \n\n__________________________________________________________(Seal)
        \n - Borrower \n \n\n__________________________________________________________(Seal)
        \n - Borrower \n \n\n__________________________________________________________(Seal)
        \n - Borrower \n \n [Sign Original Only] \n\nMULTISTATE FIXED RATE NOTE—Single
        Family—Fannie Mae/Freddie Mac UNIFORM INSTRUMENT Form 3200    1/01  (page
        3 of 3 pages)\n\nThe Note is the legal document you sign to agree to repay
        your mortgage. \nThe Note will provide you with details regarding your loan,
        including the \namount you owe, the interest rate of the mortgage loan, the
        dates when \nthe payments are to be made, the length of time for repayment,
        and the \nplace where the payments are to be sent. The Note also explains
        the \nconsequences of failing to make your monthly mortgage payments. Read
        \nthis document carefully. If something is different from what you agreed
        \nupon, contact your lender right away.\n\nGUIDE TO CLOSING FORMS\n\nPromissory
        Note\n\nBreaking down the form \n1.  Total amount of money you\n\nare borrowing.\n\n2.  This
        is your interest rate. If\nyou have an adjustable rate\nmortgage, this is
        your initial\ninterest rate.\n\n3.  This section explains the\nconsequences
        of being late\non your monthly payment.\n\n4.  This sample form is for a fixed\nrate.
        However, if the loan is\nan Adjustable Rate Mortgage\n(ARM) you will find an\nexplanation
        for the way that\nyour interest rate can change,\nand any caps on how much
        it\ncould increase.\n\nGet a copy of the  \nPromissory Note \n\nNOTE \n\n___________________________,
        ________ ___________________________, ______________ \n[Date]    [City]     [State]
        \n\n______________________________________________________________________________________________________
        \n[Property Address] \n\n1. BORROWER’S PROMISE TO PAY\nIn return for a loan
        that I have received, I promise to pay U.S. $____________________ (this amount
        is called “Principal”),\n\nplus interest, to the order of the Lender.  The
        Lender is ____________________________________________________________ \n_________________________________________________________________________________.  I
        will make all payments \nunder this Note in the form of cash, check or money
        order. \n\nI understand that the Lender may transfer this Note.  The Lender
        or anyone who takes this Note by transfer and who is entitled \nto receive
        payments under this Note is called the “Note Holder.” \n2. INTEREST\n\nInterest
        will be charged on unpaid principal until the full amount of Principal has
        been paid.  I will pay interest at a yearly rate \nof _______________%. \n\nThe
        interest rate required by this Section 2 is the rate I will pay both before
        and after any default described in Section 6(B) of \nthis Note. \n3. PAYMENTS\n\n(A)
        Time and Place of Payments\nI will pay principal and interest by making a
        payment every month. \nI will make my monthly payment on the _________ day
        of each month beginning on __________________, _____.  I will \n\nmake these
        payments every month until I have paid all of the principal and interest and
        any other charges described below that I \nmay owe under this Note.  Each
        monthly payment will be applied as of its scheduled due date and will be applied
        to interest before \nPrincipal. If, on ______________________________, 20____,
        I still owe amounts under this Note, I will pay those amounts in \nfull on
        that date, which is called the “Maturity Date.” \n\nI will make my monthly
        payments at _____________________________________________________________________
        \n______________________________ or at a different place if required by the
        Note Holder. \n\n(B) Amount of Monthly Payments \nMy monthly payment will
        be in the amount of U.S. $_______________________________. \n\n4. BORROWER’S
        RIGHT TO PREPAY \nI have the right to make payments of Principal at any time
        before they are due.  A payment of Principal only is known as a \n\n“Prepayment.”  When
        I make a Prepayment, I will tell the Note Holder in writing that I am doing
        so.  I may not designate a \npayment as a Prepayment if I have not made all
        the monthly payments due under the Note. \n\nI may make a full Prepayment
        or partial Prepayments without paying a Prepayment charge.  The Note Holder
        will use my \nPrepayments to reduce the amount of Principal that I owe under
        this Note.  However, the Note Holder may apply my Prepayment \nto the accrued
        and unpaid interest on the Prepayment amount, before applying my Prepayment
        to reduce the Principal amount of \nthe Note. If I make a partial Prepayment,
        there will be no changes in the due date or in the amount of my monthly payment
        unless \nthe Note Holder agrees in writing to those changes. \n5. LOAN CHARGES
        \n\nIf a law, which applies to this loan and which sets maximum loan charges,
        is finally interpreted so that the interest or other \nloan charges collected
        or to be collected in connection with this loan exceed the permitted limits,
        then:  (a) any such loan charge \nshall be reduced by the amount necessary
        to reduce the charge to the permitted limit; and (b) any sums already collected
        from me \nwhich exceeded permitted limits will be refunded to me.  The Note
        Holder may choose to make this refund by reducing the \nPrincipal I owe under
        this Note or by making a direct payment to me.  If a refund reduces Principal,
        the reduction will be treated as \na partial Prepayment. \n\nMULTISTATE FIXED
        RATE NOTE—Single Family—Fannie Mae/Freddie Mac UNIFORM INSTRUMENT Form 3200    1/01  (page
        1 of 3 pages)\n\n6. BORROWER’S FAILURE TO PAY AS REQUIRED \n(A) Late Charge
        for Overdue Payments \nIf the Note Holder has not received the full amount
        of any monthly payment by the end of ___________ calendar days after \n\nthe
        date it is due, I will pay a late charge to the Note Holder.  The amount of
        the charge will be _____% of my overdue payment of \nprincipal and interest.  I
        will pay this late charge promptly but only once on each late payment. \n\n(B)
        Default \nIf I do not pay the full amount of each monthly payment on the date
        it is due, I will be in default. \n(C) Notice of Default \nIf I am in default,
        the Note Holder may send me a written notice telling me that if I do not pay
        the overdue amount by a \n\ncertain date, the Note Holder may require me to
        pay immediately the full amount of Principal which has not been paid and all
        the \ninterest that I owe on that amount.  That date must be at least 30 days
        after the date on which the notice is mailed to me or \ndelivered by other
        means. \n\n(D) No Waiver By Note Holder \nEven if, at a time when I am in
        default, the Note Holder does not require me to pay immediately in full as
        described above, the \n\nNote Holder will still have the right to do so if
        I am in default at a later time. \n(E) Payment of Note Holder’s Costs and
        Expenses \nIf the Note Holder has required me to pay immediately in full as
        described above, the Note Holder will have the right to be \n\npaid back by
        me for all of its costs and expenses in enforcing this Note to the extent
        not prohibited by applicable law.  Those \nexpenses include, for example,
        reasonable attorneys’ fees. \n7. GIVING OF NOTICES \n\nUnless applicable law
        requires a different method, any notice that must be given to me under this
        Note will be given by \ndelivering it or by mailing it by first class mail
        to me at the Property Address above or at a different address if I give the
        Note \nHolder a notice of my different address. \n\nAny notice that must be
        given to the Note Holder under this Note will be given by delivering it or
        by mailing it by first class \nmail to the Note Holder at the address stated
        in Section 3(A) above or at a different address if I am given a notice of
        that different \naddress. \n8. OBLIGATIONS OF PERSONS UNDER THIS NOTE\n\nIf
        more than one person signs this Note, each person is fully and personally
        obligated to keep all of the promises made in this\nNote, including the promise
        to pay the full amount owed.  Any person who is a guarantor, surety or endorser
        of this Note is also \nobligated to do these things.  Any person who takes
        over these obligations, including the obligations of a guarantor, surety or
        \nendorser of this Note, is also obligated to keep all of the promises made
        in this Note.  The Note Holder may enforce its rights \nunder this Note against
        each person individually or against all of us together.  This means that any
        one of us may be required to \npay all of the amounts owed under this Note.
        \n9. WAIVERS \n\nI and any other person who has obligations under this Note
        waive the rights of Presentment and Notice of Dishonor. \n“Presentment” means
        the right to require the Note Holder to demand payment of amounts due.  “Notice
        of Dishonor” means the \nright to require the Note Holder to give notice to
        other persons that amounts due have not been paid. \n10. UNIFORM SECURED NOTE\n\nThis
        Note is a uniform instrument with limited variations in some jurisdictions.  In
        addition to the protections given to the\nNote Holder under this Note, a Mortgage,
        Deed of Trust, or Security Deed (the “Security Instrument”), dated the same
        date as this \nNote, protects the Note Holder from possible losses which might
        result if I do not keep the promises which I make in this Note.  \nThat Security
        Instrument describes how and under what conditions I may be required to make
        immediate payment in full of all \namounts I owe under this Note.  Some of
        those conditions are described as follows: \n\nIf all or any part of the Property
        or any Interest in the Property is sold or transferred (or if Borrower is
        \nnot a natural person and a beneficial interest in Borrower is sold or transferred)
        without Lender’s prior \nwritten consent, Lender may require immediate payment
        in full of all sums secured by this Security \nInstrument. However, this option
        shall not be exercised by Lender if such exercise is prohibited by \nApplicable
        Law. \n\nMULTISTATE FIXED RATE NOTE—Single Family—Fannie Mae/Freddie Mac UNIFORM
        INSTRUMENT Form 3200    1/01  (page 2 of 3 pages)\n\nConsumer Financial\nProtection
        Bureau Learn more at consumerfinance.gov/owning-a-home 1 of 4\n\n1\n\n2\n\n3\n\n4\n\nhttps://www.fanniemae.com/content/legal_form/3200.pdf\nhttps://www.fanniemae.com/content/legal_form/3200.pdf\nhttp://www.consumerfinance.gov/owning-a-home/\n\n\nThis
        document may be called the Mortgage, Security Instrument, or \nDeed of Trust.
        When you sign this document, you are giving the lender \nthe right to take
        your property by foreclosure if you fail to pay your \nmortgage according
        to the terms you’ve agreed to. This document \nrestates the basic information
        included in the Promissory Note, as \nwell as explains your responsibilities
        and rights as a borrower. The \nmortgagee refers to the lender or the “recipient
        of the mortgage.”\n\nGUIDE TO CLOSING FORMS\n\nMortgage / Security Instrument\n\nBreaking
        down the \nMortgage \nOccupancy: Note that if the \nOccupancy section states
        that \nyou will occupy the property as \nyour principal residence, then \nyou
        must do so. If you do not \nmove in and continue to use \nthe property as
        your principal \nresidence according to the \nconditions in this section,
        you \ncould risk foreclosure.\n\nHazardous Substances: This \nstates that
        you are not allowed to \nstore hazardous materials in your \nhome. If you
        do, you are violating \nthe terms of your loan and your \nlender could foreclose.\n\nGet
        a copy of a sample \nMortgage \n\nCalifornia -- Single Family -- Fannie Mae/Freddie
        Mac UNIFORM INSTRUMENT Form 3005 1/01 (Page 9 of 22)\n\ninsurance was required
        by Lender, shall be applied to restoration or repair of the Property, if the
        \n\nrestoration or repair is economically feasible and Lender\u0027s security
        is not lessened. During such \n\nrepair and restoration period, Lender shall
        have the right to hold such insurance proceeds until \n\nLender has had an
        opportunity to inspect such Property to ensure the work has been completed
        to\n\nLender\u0027s satisfaction, provided that such inspection shall be undertaken
        promptly. Lender may \n\ndisburse proceeds for the repairs and restoration
        in a single payment or in a series of progress \n\npayments as the work is
        completed. Unless an agreement is made in writing or Applicable Law\n\nrequires
        interest to be paid on such insurance proceeds, Lender shall not be required
        to pay \n\nBorrower any interest or earnings on such proceeds. Fees for public
        adjusters, or other third \n\nparties, retained by Borrower shall not be paid
        out of the insurance proceeds and shall be the sole \n\nobligation of Borrower.
        If the restoration or repair is not economically feasible or Lender\u0027s
        \n\nsecurity would be lessened, the insurance proceeds shall be applied to
        the sums secured by this \n\nSecurity Instrument, whether or not then due,
        with the excess, if any, paid to Borrower. Such \n\ninsurance proceeds shall
        be applied in the order provided for in Section 2.\n\nIf Borrower abandons
        the Property, Lender may file, negotiate and settle any available \n\ninsurance
        claim and related matters. If Borrower does not respond within 30 days to
        a notice \n\nfrom Lender that the insurance carrier has offered to settle
        a claim, then Lender may negotiate \n\nand settle the claim. The 30-day period
        will begin when the notice is given. In either event, or if\n\nLender acquires
        the Property under Section 22 or otherwise, Borrower hereby assigns to Lender
        \n\n(a) Borrower\u0027s rights to any insurance proceeds in an amount not
        to exceed the amounts unpaid \n\nunder the Note or this Security Instrument,
        and (b) any other of Borrower\u0027s rights (other than the \n\nright to any
        refund of unearned premiums paid by Borrower) under all insurance policies\n\ncovering
        the Property, insofar as such rights are applicable to the coverage of the
        Property. \n\nLender may use the insurance proceeds either to repair or restore
        the Property or to pay amounts \n\nunpaid under the Note or this Security
        Instrument, whether or not then due. \n\n6. Occupancy. Borrower shall occupy,
        establish, and use the Property as Borrower\u0027s \n\nprincipal residence
        within 60 days after the execution of this Security Instrument and shall \n\ncontinue
        to occupy the Property as Borrower\u0027s principal residence for at least
        one year after the \n\ndate of occupancy, unless Lender otherwise agrees in
        writing, which consent shall not be \n\nunreasonably withheld, or unless extenuating
        circumstances exist which are beyond Borrower\u0027s \n\ncontrol. \n\nCalifornia
        -- Single Family -- Fannie Mae/Freddie Mac UNIFORM INSTRUMENT Form 3005 1/01
        (Page 19 of 22)\n\nNeither Borrower nor Lender may commence, join, or be joined
        to any judicial action (as \n\neither an individual litigant or the member
        of a class) that arises from the other party\u0027s actions \n\npursuant to
        this Security Instrument or that alleges that the other party has breached
        any \n\nprovision of, or any duty owed by reason of, this Security Instrument,
        until such Borrower or \n\nLender has notified the other party (with such
        notice given in compliance with the requirements \n\nof Section 15) of such
        alleged breach and afforded the other party hereto a reasonable period\n\nafter
